import logo from "../../assets/pokemonLogo.svg";
import { HeaderContainer, ButtonGoToPage } from "./style";

function Header({ headerProps }) {
  const { page, buttonFunction, textButton } = headerProps;
  return (
    <HeaderContainer>
      {page !== "pokemonsList" && <buttonReturnPage onClick={buttonFunction}>{textButton}</buttonReturnPage>}
      <img src={logo} alt="" />
      {page !== "pokedex" && <ButtonGoToPage onClick={buttonFunction}>{textButton}</ButtonGoToPage>}
    </HeaderContainer>
  );
}
export default Header;
